import Sky from "./components/Sky";
import Navbar from "./components/Navbar";
import { ThemeProvider, createTheme } from '@material-ui/core/styles';

const theme = createTheme({
  typography: {
    fontFamily: [
      'Spartan',
      'sans-serif',
    ].join(','),
  },
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <div className="App">
        <Sky />
        <Navbar />
      </div>
    </ThemeProvider>

  );
}

export default App;
